  "qa1_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\xBFEl sitio web es gratis?" } },
  "qa1_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "No completamente gratis. Para el desarrollo a largo plazo, los cargos futuros son inevitables, pero no se requerir\xE1 pago para usar. Intentamos encontrar un equilibrio entre gratis y de pago." } },
  "qa1_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "El proyecto es de c\xF3digo abierto, puedes implementarlo t\xFA mismo." } },
  "qa2_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\xBFNo puede escribir, el teclado no responde?" } },
  "qa3_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\xBFD\xF3nde est\xE1n los datos? \xBFC\xF3mo usar en m\xFAltiples computadoras/dispositivos?" } },
  "qa3_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Todos los datos del usuario se guardan en el navegador local. Si necesita usar Type Words en diferentes dispositivos o navegadores, debe exportar e importar datos manualmente." } },
  "qa3_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Configuraci\xF3n -> Configuraci\xF3n de datos -> Exportar datos en la computadora original -> Enviar a la nueva computadora a trav\xE9s de software social -> Importar en la nueva computadora" } },
  "qa3_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "El sistema de cuentas est\xE1 en desarrollo." } },
  "qa4_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "El sitio web planifica demasiadas palabras autom\xE1ticamente, \xBFc\xF3mo modificar?" } },
  "qa4_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "La proporci\xF3n predeterminada de palabras de repaso a palabras nuevas es 1:4." } },
  "qa4_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Puede modificarlo en Configuraci\xF3n -> Configuraci\xF3n de palabras -> Proporci\xF3n de repaso" } },
  "qa5_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Se tarda demasiado en completar una sesi\xF3n de aprendizaje, \xBFel proceso es demasiado largo?" } },
  "qa5_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Este es de hecho un problema. Un proceso largo puede hacer que la gente pierda la motivaci\xF3n." } },
  "qa5_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Las palabras incorrectas se repetir\xE1n. Si fue solo un error de escritura, puede presionar Tab para omitir." } },
  "qa5_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'Durante la revisi\xF3n, solo las palabras marcadas como "no conozco" requieren dictado.' } },
  "qa5_q4": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Despu\xE9s del lanzamiento del sistema de cuentas, se agregar\xE1 la funci\xF3n de curva de memoria de Ebbinghaus." } },
  "qa6_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\xBFSe agregar\xE1 la funci\xF3n de curva de memoria de Ebbinghaus?" } },
  "qa7_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\xBFPuedo agregar palabras/diccionarios personalizados/importar mis propias palabras?" } },
  "qa7_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'S\xED, en la p\xE1gina de Palabras, haga clic en "Crear diccionario personal"' } },
  "qa7_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'Despu\xE9s de la creaci\xF3n, haga clic en el icono "Agregar palabra" para agregar sus propias palabras' } },
  "qa7_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'Tambi\xE9n puede hacer clic en el icono "Importar" para importar en lote' } },
  "qa8_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\xBFPuedo agregar art\xEDculos/libros personalizados/importar mis propios art\xEDculos?" } },
  "qa8_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "S\xED, los pasos son b\xE1sicamente los mismos que agregar palabras" } },
  "qa8_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'En la p\xE1gina de Art\xEDculos, haga clic en "Crear libro personal"' } },
  "qa8_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'Despu\xE9s de la creaci\xF3n, haga clic en el bot\xF3n "Gesti\xF3n de art\xEDculos" en la parte superior' } },
  "qa9_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\xBFC\xF3mo desactivar los sonidos de las teclas?" } },
  "qa9_q": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Configuraci\xF3n -> Configuraci\xF3n general -> Efectos de sonido -> Sonido de teclas, desactivarlo" } },
  "qa10_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\xBFPuedo usarlo en una tableta?" } },
  "qa10_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Las tabletas se pueden usar, pero usar un teclado Bluetooth proporciona una mejor experiencia." } },
  "qa10_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": 'Despu\xE9s de conectar un teclado Bluetooth, las tabletas Android necesitan habilitar manualmente el "Modo de escritorio".' } },
  "qa11_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\xBFPuedo usarlo en un tel\xE9fono?" } },
  "qa11_q": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Los tel\xE9fonos se pueden usar, pero la optimizaci\xF3n para tel\xE9fonos a\xFAn no se ha realizado. Se recomienda usar en una computadora o tableta." } },
  "qa12_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\xBFHay una APP o mini-programa?" } },
  "qa12_q": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "No, solo el sitio web" } },
