  "qa13_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Puede unirse a nuestro grupo oficial de WeChat, describir en detalle las funciones que desea" } },
  "qa13_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Si encuentra errores en la aplicaci\xF3n, proporcione una descripci\xF3n detallada y los pasos para reproducir" } },
  "qa13_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Tambi\xE9n puede enviarnos un ticket de soporte" } },
